\boxed{\begin{align*}
h(x)&=f(g(x))\\
&=f(x-1)\\
&=7(x-1)+5\\
&=7x-2
\end{align*}
To find the inverse of $h(x)$, we need to swap $x$ and $y$ and solve for $y$.
\begin{align*}
x&=7y-2\\
y&=\frac{x+2}{7}
\end{align*}
So, the inverse of $h(x)$ is $h^{-1}(x)=\frac{x+2}{7}$.}

