\text{If } t > 60, \text{ then } P = 70 - (t - 60) = 130 - t
\end{align*}

\begin{align*}
\text{For } t \leq 60, \text{ the revenue } R &amp;= P \cdot t = 70t\\
\text{For } t > 60, \text{ the revenue } R &amp;= P \cdot t = (130 - t)t
\end{align*}

\begin{align*}
\text{For } t \leq 60, \text{ the cost } C &amp;= 70t\\
\text{For } t > 60, \text{ the cost } C &amp;= 70t
\end{align*}

\begin{align*}
\text{For } t \leq 60, \text{ the profit } P &amp;= R - C = 70t - 70t = 0\\
\text{For } t > 60, \text{ the profit } P &amp;= R - C = (130 - t)t - 70t = 130t - t^2 - 70t = 60t - t^2
\end{align*}

\begin{align*}
