\boxed{\begin{align*}
x^2 + y^2 = 4x + 8y\\
\Rightarrow\qquad x^2 - 4x + y^2 - 8y = 0\\
\Rightarrow\qquad (x^2 - 4x + 4) + (y^2 - 8y + 16) = 20\\
\Rightarrow\qquad (x - 2)^2 + (y - 4)^2 = 20\\
\Rightarrow\qquad (x - 2)^2 + (y - 4)^2 = 2^2 \cdot 5
\end{align*}
This is a circle with center $(2,4)$ and radius $2\sqrt{5}$.  The shortest distance from the point $(5,-2)$ to this circle is the distance from the point to the center minus the radius.  This is
\begin{align*}
\sqrt{(5-2)^2 + (-2-4)^2} - 2\sqrt{5} &= \sqrt{9 + 36} - 2\sqrt{5}\\
&= \sqrt{45} - 2\sqrt{5}\\
&= \sqrt{9\cdot 5} - 2\sqrt{5}\\
&= 3\sqrt{5} - 2\sqrt{5}\\
&= \sqrt{5}
\end{align*}
Therefore, the answer is $\boxed{5}$.}

\boxed{\begin{align*}
24x^2-19x-35 &=(Ax-5)(2Bx+C)\\
&=2ABx^2+(AC-5B)x-5C
\end{align*}
Equating the coefficients of the $x^2$ terms, we get $2AB=24$, so $AB=12$.  Equating the constant terms, we get $-5C=-35$, so $C=7$.  Equating the coefficients of the $x$ terms, we get $AC-5B=-19$.  Substituting $AB=12$ and $C=7$, we get $7A-5B=-19$.  Since $AB=12$, we have $B=\frac{12}{A}$.  Substituting this into the previous equation, we get $7A-5\left(\frac{12}{A}\right)=-19$.  Multiplying both sides by $A$, we get $7A^2-60=-19A$.  Rearranging, we get $7A^2+19A-60=0$.  Factoring, we get $(A+12)(7A-5)=0$.  Therefore, $A=-12$ or $A=\frac{5}{7}$.  Since $A$ is a positive number, we must have $A=\frac{5}{7}$.  Therefore, $B=\frac{12}{A}=\frac{12}{\frac{5}{7}}=\frac{84}{5}$.  Finally, we have $AB-3C=\left(\frac{5}{7}\right)\left(\frac{84}{5}\right)-3(7)=12-21=\boxed{-9}$.}

