\boxed{
Let's say Lara read $x$ pages on the first day. Then she read $\frac{x}{2}$ pages on the second day, $\frac{x}{4}$ pages on the third day, $\frac{x}{8}$ pages on the fourth day, and $\frac{x}{16}$ pages on the fifth day. The total number of pages she read is the sum of these, which is $x + \frac{x}{2} + \frac{x}{4} + \frac{x}{8} + \frac{x}{16}$. This sum is equal to 248, so we have the equation
\begin{align*}
x + \frac{x}{2} + \frac{x}{4} + \frac{x}{8} + \frac{x}{16} &= 248 \\
\frac{16x + 8x + 4x + 2x + x}{16} &= 248 \\
\frac{31x}{16} &= 248 \\
31x &= 248 \cdot 16 \\
31x &= 3968 \\
x &= \frac{3968}{31} \\
x &= 128
\end{align*}
So Lara read 128 pages on the first day.
}

