\begin{pmatrix} a & b \\ c & d \end{pmatrix} \begin{pmatrix} 1 \\ -3 \end{pmatrix} &= \begin{pmatrix} 7 \\ -1 \end{pmatrix}.
\end{align*}
This gives us the following system of equations:
\begin{align*}
2a - b &= 9,\\
2c - d &= 3,\\
a - 3b &= 7,\\
c - 3d &= -1.
\end{align*}
Solving this system of equations, we find that $a = 5$, $b = -1$, $c = 2$, and $d = -1.$  Therefore, the matrix $\mathbf{M}$ is
\begin{align*}
\mathbf{M} = \begin{pmatrix} 5 & -1 \\ 2 & -1 \end{pmatrix}.
\end{align*}
Now, we want to find the image of the line $y = 2x + 1$ under $\mathbf{M}.$  We can write the line $y = 2x + 1$ as
\begin{align*}
\begin{pmatrix} x \\ 2x + 1 \end{pmatrix}.
\end{align*}
Then the image of the line $y = 2x + 1$ under $\mathbf{M}$ is
\begin{align*}
\begin{pmatrix} 5 & -1 \\ 2 & -1 \end{pmatrix} \begin{pmatrix} x \\ 2x + 1 \end{pmatrix} = \begin{pmatrix} 5x - (2x + 1) \\ 2x - (2x + 1) \end{pmatrix} = \begin{pmatrix} 3x - 1 \\ -1 \end{pmatrix}.
\end{align*}
Therefore, the image of the line $y = 2x + 1$ under $\mathbf{M}$ is the line $y = -1.$}

