Since $\tan \theta = 2,$ we have $\theta = \arctan 2.$  Using the double-angle formulas, we have $\cos(2\theta) = \frac{1}{\sqrt{5}}$ and $\sin(2\theta) = \frac{2}{\sqrt{5}}.$  Therefore, the expression simplifies to
